import React from "react";

const experience = () => {
  return (
    <div
      style={{
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
        height: "100vh",
      }}
    >
        <h1>
            Experience Page
        </h1>
    </div>
  );
};

export default experience;
